{"operationName":"getAllBroadcastData","variables":{"broadcastId":"0583e94d-262b-43c4-add7-2a7a28c58f18"},"query":"query getAllBroadcastData($broadcastId: String!) {
  getAllBroadcastData(broadcastId: $broadcastId) {
    broadcast {
      ...BroadcastFragment
    }
    vodEvents {
      ...VodEventFragment
    }
    carousel {
      ...CarouselFragment
    }
  }
}

fragment BroadcastFragment on Broadcast {
  liveViewers
  isChatEnabled
  status
  chatStatus
  startTime
  moderated
  hlsUrl
  videoMetadata {
    customerId
    contentId
    sessionId
  }
  title
  pinnedMessage {
    text
    promoId
    status
    displayType
    message
  }
  promotions {
    associatedAsins
    description
    discountPercent
    groupClaimCode
    id
  }
}

fragment VodEventFragment on VodEvent {
  eventOffsetMS
  eventType
  eventValue
}

fragment CarouselFragment on Carousel {
  highlightedItemId
  hash
  items {
    asin
    brand
    canAddToCart
    digitalProduct
    eligibleForPrimeShipping
    formattedImageUrl
    formattedListPrice
    formattedPrice
    formattedPriceV2
    formattedPrimePrice
    totalPercentageOff
    promotionType
    hasHalfStar
    offerListingId
    outOfStock
    productLink
    singularItem
    starCount
    ratingValue
    title
    totalReviewCount
    dealBadge {
      labelBackgroundColor
      labelColor
      labelText
      messageBackgroundColor
      messageColor
      messageText
      messageTimerEndTime
    }
  }
  promoCodes {
    asin
    promoCodes
  }
  segments {
    name
    segmentItems {
      segmentItemId
      type
      asin
      actionButtonText
      backgroundImageUrl
      badgeText
      imageUrl
      title
      url
      retargetingPixel
      revealData {
        time
        text
        subtext
        percent
      }
    }
  }
  deals {
    asin
    dealPrice {
      currencySymbol
      fractionalValue
      wholeValue
    }
    dealType
    dealId
    endDate
    listPrice {
      currencySymbol
      fractionalValue
      wholeValue
    }
    percentClaimed
    percentOff
    primeAccessType
    primeExclusive
    state
    dealBadge {
      labelBackgroundColor
      labelColor
      labelText
      messageBackgroundColor
      messageColor
      messageText
      messageTimerEndTime
    }
  }
}
"}
